import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./Login.tsx";
import Dashboard from "./Dashboard.tsx";
import AuctionDetails from "./AuctionDetails.tsx";
import UserDashboard from "./UserDashboard.tsx";
import AuthPage from "./AuthPage.tsx";
import PaymentCheckoutPage from "./PaymentCheckoutPage.tsx";
import BiddingHistory from "./BiddingHistory.tsx";
import UserInfoForm from "./UserInfoForm.tsx";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/LoginPage" element={<Login />} />
        <Route path="/Dashboard" element={<Dashboard />} />
        <Route path="/AuctionDetails" element={<AuctionDetails />} />
        <Route path="/PaymentCheckoutPage" element={<PaymentCheckoutPage />} />
        <Route path="/UserDashboard" element={<UserDashboard />} />
        <Route path="/AuthPage" element={<AuthPage />} />
        <Route path="/bidding-history" element={<BiddingHistory />} />
        <Route path="/UserInfoForm" element={<BiddingHistory />} />
        <Route path="/signup" element={<UserInfoForm />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
